import React from 'react';
import Article from './Article';

class Blog extends React.Component{
  constructor(props) {
    super(props);
  }
  render() {
    const authorName = "Torahack"
    return (
      <>
        <Article
          title={"トラハック"}
          order={3}
          isPublished={true}
          author={authorName}
        />        
      </>

    )
  }
} 

export default Blog
